import React from "react";
import PropTypes from 'prop-types';

const Header = ({ number, children, isChildren }) => {
  return (
    <>
      <h1>{number + 1}</h1>
      {isChildren ? <h2>{children}</h2> : <h2>false</h2>}
    </>
  );
};

const App = () => {
  const number = '넘버';
  const isChildren = false;
  return (
    <>
      <Header number={number} isChildren={isChildren}>hi</Header>
    </>
  );
};

Header.propTypes = {
  number: PropTypes.number,
};

export default App;
// export { App };
